import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class EmpformserviceService {

  constructor(private http:HttpClient) { }


  baseUrl = "http://localhost:3000"

  submitapi(data:any){
    console.log(data)
    return this.http.post(this.baseUrl+"/signupEmp/",data);
  }


}
